      <Avatar sx={{ width: "23rem", height: "27rem" }} alt="Remy Sharp" src="https://t2.gstatic.com/licensed-image?q=tbn:ANd9GcQOO0X7mMnoYz-e9Zdc6Pe6Wz7Ow1DcvhEiaex5aSv6QJDoCtcooqA7UUbjrphvjlIc" />
    </div>
    </>
  );
}



export default App;
